import ProjManage from "./Logo.png"

const Projects = () => {
    return (  
        <div className="relative h-screen w-screen bg-slate-300 flex justify-center items-center">
            <a className="absolute top-0" id="Projects"></a>
            <h1 className="absolute pt-10 text-5xl top-10">Projects</h1>
            <div className="relative bg-slate-400 w-5/6 h-4/6 flex">
            <a className="bg-red-50 w-screen in" href="https://project-6olz.onrender.com"><img className="p-10 h-full"src={ProjManage}></img></a>
                <p className="text-4xl p-20">ProjManage is a website I developed where users are able to display their projects. The web application utilizes React.js for the frontend, Node.js and Express.js for the backend, and MongoDB for the backend. Users are able to create their accounts securely and exhibit their creations! To view my projects <a className="underline hover:text-blue-800"href="https://project-6olz.onrender.com/user/AlexNham">click here</a></p>
            </div>
        </div>
    );
}

export default Projects;
